Parameter.Abstract:
array containing dictionaries of floor info. Example for one floor:
{
     "id" : @"MISTFLOORNAME",
     "maasId" : 195842,

     "topLeft" : {
         "longitude" : -97.742525,
         "latitude" : 30.360108
     },
     "topRight" : {
         "longitude" : -97.741753,
         "latitude" : 30.359737
     }
     "bottomLeft" : {
         "longitude" : -97.741753,
         "latitude" : 30.359737
     }
}
